import React from "react";
import { getalldata } from "./Feature/slice";
import { useSelector, useDispatch } from "react-redux";

function App1() {
  const dispatch = useDispatch();
  const data = useSelector((state) => state.app);
  console.log(data.users);
  return (
    <div>
      <h1>welcome</h1>
      <button onClick={() => dispatch(getalldata())}>Submit</button>
      {data.map((item) => {
        return (
          <>
            <h1>{item.name}</h1>
          </>
        );
      })}
    </div>
  );
}

export default App1;
